import React from 'react';

class Title extends React.Component {
  render() {
    return (
      <div className="content bg-c-gray" id="title">
        <p>걱정없이 집을 나가자!</p>
        <h1>EASYWAY</h1>
      </div>
    );
  }
}

export default Title;
